import { configureStore } from '@reduxjs/toolkit';
import fishDataReducer from './fishData/dataSlice';
import bugDataReducer from './bugData/dataSlice';

export default configureStore({
    reducer: {
        data: fishDataReducer, bugDataReducer
    },
});
